package capsule_14_bySweety;

public class Print_1to20_all_odd_no_using_Countinue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int str =1 ;
		int end = 20 ;
		
		while(str<=end)
		{
			str++ ;
			if(str%2!=0)
			{  
				System.out.println(str);
				continue ;
			}
			
		
	     }
	
	}

}
